'use strict';(function(){const indexCfg={cache:true};indexCfg.doc={id:'id',field:['title','content'],store:['title','href','section'],};const index=FlexSearch.create('balance',indexCfg);window.bookSearchIndex=index;index.add({'id':0,'href':'/bash/files/','title':"Files",'section':"Bash",'content':"August 1, 2018\n Chmod #  Default permission:\nchmod 755 # DIR -rwxr-xr-x chmod 644 # FILE -rw-r--r--  Change all directories to 755:\nfind . -type d -exec chmod 755 {} \\;  Change all files to 644 under current directory:\nfind . -type f -exec chmod 644 {} \\;  Rename Multiple #  for i in *.js; do mv \u0026quot;$i\u0026quot; \u0026quot;./${i/pattern/replace}\u0026quot;; done  Example:\nRename list of files from: ic-one.svg -\u0026gt; one.svg ic-two.svg -\u0026gt; two.svg ic-three.svg -\u0026gt; three.svg for i in *.svg; do mv \u0026quot;$i\u0026quot; \u0026quot;./${i/ic-//}\u0026quot;; done  Encrypt / Decrypt #  Show list of ciphers:\nopenssl list-cipher-commands  Encrypt file.txt to file.cryp using 256-bit AES in CBC mode:\nopenssl enc -aes-256-cbc -salt -in file.txt -out file.cryp  Same as above, only the output is base64 encoded (for e-mails, etc):\nopenssl enc -aes-256-cbc -a -salt -in file.txt -out file.cryp  Decrypt binary file.cryp:\nopenssl enc -d -aes-256-cbc -in file.cryp  Decrypt base64-encoded version:\nopenssl enc -d -aes-256-cbc -a -in file.cryp  "});index.add({'id':1,'href':'/bash/networking/','title':"Networking",'section':"Bash",'content':"December 12, 2020\n WiFi #  Turn off IPv6 on Mac OS:\nnetworksetup -setv6off Wi-Fi  "});index.add({'id':2,'href':'/git/all/','title':"All",'section':"Git",'content':"Jan 12, 2014\n Restore Version #  Restore a version of a file to the one before commit h0a0s0h (~1 for 1 above version):\ngit checkout h0a0s0h~1 -- file1/to/restore file2/to/restore  Checkout from specific branch #  Example - if your current branch is feature/123, and you\u0026rsquo;re rebasing it on top of master:\ngit checkout feature/123 git rebase master  and run into conflicts on some file (src/some/file.js), you can revert this file to master\u0026rsquo;s version with:\ngit checkout master -- src/some/file.js  or use ours and theirs aliases:\ngit checkout --ours src/some/file.js git checkout --theirs src/some/file.js  Diff between branches #  Show difference between HEAD and specific branch:\ngit diff master src/some/file.js  "});index.add({'id':3,'href':'/js/example/','title':"Example",'section':"JavaScript",'content':"Example #  "});index.add({'id':4,'href':'/vim/buffers/','title':"Buffers",'section':"Vim",'content':"Navigation #  Navigate through buffers:\n:next | :n | ]] :prev | :p | [[  Open all files returned from grep #  vim $(grep -lri 'pattern' .)  Search and replace multiple files #  Open multiple files into buffers:\nvim ./*.js  run:\n:bufdo %s/pattern/replace/ge [| update]  update flag is optional if you have \u0026lsquo;set hidden\u0026rsquo; vim flag enabled.\nThe same can be accomplished with arglist without loading files into buffers.\nFirst add files to arglist:\n:argadd *.js  Then replace with:\n:argdo %s/foo/bar/ge  "});index.add({'id':5,'href':'/bash/postgres/','title':"Postgres",'section':"Bash",'content':"December 12, 2018\n Connect #  psql -hlocalhost -Uusername -W -ddatabasename  "});})();